import React from 'react';
import {Link} from "../../../../components/Link";
import {S} from '../Works_Styles'


export const TabMenu: React.FC<{
        tabsItems: Array<{ title: string, status: "all" | "landing" | "spa" | "react" }>, changeFilterStatus()
    }> = (props: {
        tabsItems: Array<{ title: string, status: "all" | "landing" | "spa" | "react" }>
    }) => {
        return (
            <div>
                <S.TabMenu>
                    <ul>
                        {props.tabsItems.map((item, index) => {
                                return <S.ItemList key={index}>
                                    <Link href="">{item.title}</Link>
                                </S.ItemList>
                            }
                        )}
                    </ul>
                </S.TabMenu>
            </div>
        )
            ;
    }
;
